"use strict";
import logo from './IMG_0004.PNG';
import './App.css';
import Description from './Description';


import * as React from 'react';
import Box from '@mui/material/Box';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Paper from '@mui/material/Paper';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import useSound from "use-sound";
import bowl from './A_resonant_trimmed_2.mp3';
import dong from './A_dong_trimmed.wav'
import InfoIcon from '@mui/icons-material/Info';
import PeopleIcon from '@mui/icons-material/People';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import MusicNoteIcon from '@mui/icons-material/MusicNote';
import {
  HashRouter, Route, Routes,
} from 'react-router-dom';



function App (){

  const [playDong, { stop }] = useSound(dong);

  const [value, setValue] = React.useState(0);



  return (
    <div className="App"> 

      <header className="App-header">

        <button onMouseEnter={() => playDong()} >
          <img src={logo} className="App-logo" alt="logo"/>
        </button>

        <a className = "Centering" >
          Centering
        </a>

      <Typography variant="h6" className = "subHeader"> 
        A place for creation, reflection, and connection
      </Typography>
      </header> 

      <Box sx={{ width: 1 }}>
        <Paper elevation={3}>
      <BottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        <BottomNavigationAction label="Description" icon={<InfoIcon />} href="/"/>
        <BottomNavigationAction label="Events" icon={<CalendarMonthIcon />} href="/#events"/>
        <BottomNavigationAction label="About Us" icon={<PeopleIcon />} href="/#about"/>
      </BottomNavigation>
        </Paper>   
    </Box>

    <Description />

      <Routes>
        <Route path="/" element={<Description />} />
        <Route path="about" element={<About />} />
      </Routes>

    </div>
  );

}
function Home() {
  return (
    <>
      <main>
        <h2>Welcome to the homepage!</h2>
        <p>You can do this, I believe in you.</p>
      </main>
      <nav>
        <Link to="/about">About</Link>
      </nav>
    </>
  );
}

function About() {
  return (
    <>
      <main>
        <h2>Who are we?</h2>
        <p>
          That feels like an existential question, don't you
          think?
        </p>
      </main>
      <nav>
        <Link to="/">Home</Link>
      </nav>
    </>
  );
}




export default App;
